import React, { Component } from "react"
import { BrowserRouter, BrowserRouter as Router, Route, Switch } from 'react-router-dom'
import CheckCookie from "./checkCookie.js"

import Login from "./pages/access/Login.js"
import Frontpage from "./pages/frontpage/Frontpage.js"

export default class CustomRoute extends Component {
    render() {
        return (
            <BrowserRouter>
                <Switch>
                    {CheckCookie() != true ?
                        <Route exact path=
                            {"/login"} component={Login} />
                        :
                        <Route exact path=
                            {"/frontpage"} component={Frontpage} />
                    }
                </Switch>
            </BrowserRouter>
        )
    }
}
